import React from 'react';
import { FaHeart, FaShoppingCart } from 'react-icons/fa'; // For icons (optional)

function Header() {
  return (
    <header style={styles.header}>
      <div style={styles.logoSection}>
        <h1>SHOPPER</h1>
      </div>
      <nav style={styles.navSection}>
        <a href="/shop">Shop</a>
        <a href="/mens">Mens</a>
        <a href="/women">Women</a>
        <a href="/kids">Kids</a>
      </nav>
      <div style={styles.actions}>
        {/* Login Button */}
        <button style={styles.button}>Login</button>
        
        {/* Wishlist Button */}
        <button style={styles.wishlist}>
          <FaHeart /> Wishlist
        </button>
        
        {/* Cart Icon */}
        <div style={styles.cartIcon}>
          <FaShoppingCart />
          <span style={styles.cartCount}>0</span>
        </div>
      </div>
    </header>
  );
}



export default Header;
